import React, {useEffect} from 'react';
import styles from './Success.module.scss';
const Success = (props) =>{
    useEffect(() =>{
        setTimeout(() =>{
            console.log(1);
        }, 1000)
        return () =>{
            console.log(2);
            clearTimeout()
        }
    }, [])
    return(
        <div className={styles.success}>
            {props.children}
        </div>
    )
}

export default Success;
